/** 
 * Returns the value nearest to  {@code value} which is within the closed range {@code [min..max]}. <p>If  {@code value} is within the range {@code [min..max]},  {@code value} is returnedunchanged. If  {@code value} is less than {@code min},  {@code min} is returned, and if {@code value} is greater than {@code max},  {@code max} is returned.
 * @param value the {@code char} value to constrain
 * @param min the lower bound (inclusive) of the range to constrain {@code value} to
 * @param max the upper bound (inclusive) of the range to constrain {@code value} to
 * @throws IllegalArgumentException if {@code min > max}
 * @since 21.0
 */
@Beta public static char constrainToRange(char value,char min,char max){
  checkArgument(min <= max,"min (%s) must be less than or equal to max (%s)",min,max);
